import React, { Component } from 'react';
import Grid from '@material-ui/core/Grid'

import "../App.css"

const TodoSubList = props => {

    let container =
        <div className='container'>
            {props.map(input =>

                <div className='container'>
                    <div className="subitem1-container ">
                        {input.miniT}
                    </div>
                    <div className="subitem1-container ">
                        {input.completed}
                    </div>
                    <div className="subitem1-container ">
                        tester
                    </div>

                </div>
            )}

        </div>


    return container
}



export default TodoSubList;
